import React, { Component } from 'react';
import Letter from './Letter.js'


class Letters extends Component {

    renderLetters(){
        // let letterStatus = this.props.letterStatus
        // for (let i= 65; i < 91; i ++){
        //     this.render(letterStatus[String.fromCharCode(i)])
        // }
    }

    render() {
        let lettersArray = object.keys(this.props.letterStatus)
        return (
            <div>
                {lettersArray.map(l => <Letter letter={l} key={l}/>)}
            </div>
        );
    }
}

export default Letters;
